import React, {useEffect, useState} from "react";
import {ContainerCard} from "../containerCard/ContainerCard.js";

const initialState = {
  containers: [],
};

export function ContainerCardDeck(containers) {
  const [state, setState] = useState(initialState);
  const template = undefined;

  useEffect(() => {
    async function f() {
      const hej = await containers;
      setState({...state, containers: hej});
      console.log(state.containers);
      template = `{state.containers.map((container) => (
        <ContainerCard container={container} />
      ))}`;
    }
    f();
  }, []);

  return <div>{template}</div>;
}
